import React, { useContext } from 'react';
import NoteList from './NoteList';
import './NotePanel.css';
import { NotesContext } from './contexts/NotesContext';

function NotePanel (){
	const { notes, removeNote, toggleNote, editNote } = useContext(NotesContext);
	return (
		<div className="Panel d-flex text-center justify-content-center card">
			{/* <NoteForm addNote={addNote} /> */}
			<div className="card-body">
				<NoteList notes={notes} removeNote={removeNote} toggleNote={toggleNote} editNote={editNote} />
			</div>
		</div>
	);
}
export default NotePanel;
